import { lazy } from "react";
const barChart1 = lazy(() => import('./RadialProgressBar.js'))
const barChart2 = lazy(() => import('./RadialProgressBar2.js'))
const barChart3 = lazy(() => import('./RadialProgressBar3.js'))

const PercentageBars = () => {
    return(
        <div className='percentageBars'>
            <barChart1 />
            <barChart2 />
            <barChart3 />
        </div>
    )
}



export default PercentageBars;
